import React, { Component } from 'react';

class Details extends Component {
  render() {
    return (
      <div className="Home">
        <h1>{this.props.match.params.id}</h1>
        <h1>{this.props.movie.title.id}</h1>
      </div>
    );
  }
}

export default Details;
